import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Header, Transition, Button, Particles, Modal } from "arclight-react";

const _Header_ = styled.div``;

const _Modal = (props) => (
  <Modal
    theme={props.theme}
    visible={props.status}
    disableClickAway
    crown={{
      position: "right",
      constrain: false,
      content: (
        <div>
          <img src={require("./img/spirit-flower.png")} />
          <div style={{ position: "absolute", top: -55, left: -55 }}>
            <Particles
              width={300}
              height={300}
              animations={[
                {
                  name: "spiritual",
                  particleColor: "#00fff0",
                  x: 50,
                  y: 50,
                },
              ]}
              invoke={false}
            />
          </div>
        </div>
      ),
    }}
    setVisible={(a) => props.showModal(a)}
  >
    <h1>Check this out!</h1>
  </Modal>
);

export default class _ extends React.Component {
  state = {
    modalSatus: false,
  };

  showModal(modalStatus) {
    this.setState({ modalStatus });
  }

  render() {
    return (
      <ThemeProvider theme={{}}>
        <_Modal
          theme={"Dark"}
          showModal={(boolean) => this.showModal(boolean)}
          status={this.state.modalStatus}
        />
        <_Header_>
          <Header
            name={"StylishCenter"}
            textDisplay={{
              left: null,
              center: null,
              right: null,
            }}
            theme={"Dark"}
            info={{
              width: "100%",
              height: "125px",
              crown: (
                <Transition
                  trans={this.props.STATE.config.HEADER.CROWN_TRANSITION}
                >
                  <div
                    style={{
                      position: "relative",
                      width: "75px",
                      height: "75px",
                    }}
                  >
                    <img
                      src={this.props.config.LOGO}
                      style={{
                        height: "100%",
                      }}
                    />
                    <div style={{ position: "absolute", top: -75, left: -70 }}>
                      <Particles
                        width={300}
                        height={200}
                        animations={[
                          {
                            name: "spiritual",
                            particleColor: "#00fff0",
                            x: 50,
                            y: 100,
                          },
                        ]}
                        invoke={false}
                      />
                    </div>
                  </div>
                </Transition>
              ),
            }}
            controls={[
              <Transition
                trans={this.props.config.HEADER.RIGHT_TEAM_TRANSITION}
              >
                <img
                  src={require("./img/reignnew.png")}
                  style={{
                    height: "200px",
                  }}
                />
              </Transition>,
              <Transition trans={this.props.config.HEADER.LEFT_TEAM_TRANSITION}>
                <img
                  src={require("./img/ruby.png")}
                  style={{
                    height: "200px",
                  }}
                />
              </Transition>,
            ]}
          />
          <Transition trans={this.props.config.HEADER.SEASON_LOGO_TRANSITION}>
            <div style={{ marginTop: "125px", textAlign: "center" }}>
              <img
                src={this.props.config.SEASON_LOGO}
                style={{
                  width: "200px",
                }}
              />
            </div>
          </Transition>
        </_Header_>
      </ThemeProvider>
    );
  }
}
